DROP TABLE IF EXISTS activo;

CREATE TABLE `activo` (
  `idcredito` int(11) NOT NULL,
  `zona` varchar(5) NOT NULL,
  `cliente` varchar(45) NOT NULL,
  `saldo` decimal(11,2) NOT NULL,
  `proyeccion` int(11) NOT NULL,
  `vencimiento` datetime NOT NULL,
  `estado` varchar(15) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idcredito`),
  CONSTRAINT `credito` FOREIGN KEY (`idcredito`) REFERENCES `venta` (`idventa`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS caja;

CREATE TABLE `caja` (
  `idcaja` int(11) NOT NULL AUTO_INCREMENT,
  `totalingreso` decimal(11,2) NOT NULL,
  `totalsalida` decimal(11,2) NOT NULL,
  `totalsuma` decimal(11,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `estado` varchar(15) NOT NULL,
  PRIMARY KEY (`idcaja`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS cobranza;

CREATE TABLE `cobranza` (
  `idcobranza` int(11) NOT NULL AUTO_INCREMENT,
  `idventa` int(11) NOT NULL,
  `fecha_hora` datetime NOT NULL,
  `zona` varchar(15) NOT NULL,
  `monto` decimal(11,2) NOT NULL,
  `estado` varchar(45) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idcobranza`),
  KEY `idventa_idx` (`idventa`),
  CONSTRAINT `idventa` FOREIGN KEY (`idventa`) REFERENCES `venta` (`idventa`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS detalle_caja;

CREATE TABLE `detalle_caja` (
  `iddetalle_caja` int(11) NOT NULL AUTO_INCREMENT,
  `caja` int(11) NOT NULL,
  `zonaingreso` varchar(15) DEFAULT NULL,
  `ingreso` int(11) NOT NULL,
  `montoingreso` decimal(11,2) NOT NULL,
  `zonasalida` varchar(15) NOT NULL,
  `salida` int(11) NOT NULL,
  `concepto` varchar(45) NOT NULL,
  `montosalida` decimal(11,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `estado` varchar(15) NOT NULL,
  PRIMARY KEY (`iddetalle_caja`),
  KEY `caja_idx` (`caja`),
  CONSTRAINT `caja` FOREIGN KEY (`caja`) REFERENCES `caja` (`idcaja`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS detalle_liquidacion;

CREATE TABLE `detalle_liquidacion` (
  `iddetalle_liquidacion` int(11) NOT NULL AUTO_INCREMENT,
  `idliquidacion` int(11) NOT NULL,
  `zona` varchar(5) NOT NULL,
  `fecha_inicio` datetime NOT NULL,
  `fecha_fin` datetime NOT NULL,
  `cobranza` decimal(11,2) NOT NULL,
  `comision` decimal(11,2) NOT NULL,
  `anticipo` decimal(11,2) NOT NULL,
  `premio` decimal(11,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`iddetalle_liquidacion`),
  KEY `liquidacion_idx` (`idliquidacion`),
  CONSTRAINT `liquidacion` FOREIGN KEY (`idliquidacion`) REFERENCES `liquidacion` (`idliquidacion`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ingreso;

CREATE TABLE `ingreso` (
  `idingreso` int(11) NOT NULL AUTO_INCREMENT,
  `zona` varchar(10) NOT NULL,
  `empleado` int(11) NOT NULL,
  `monto` decimal(11,2) NOT NULL,
  `concepto` varchar(50) NOT NULL,
  `estado` varchar(12) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idingreso`),
  KEY `cobrador_idx` (`empleado`),
  CONSTRAINT `cobrador` FOREIGN KEY (`empleado`) REFERENCES `persona` (`idpersona`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS liquidacion;

CREATE TABLE `liquidacion` (
  `idliquidacion` int(11) NOT NULL AUTO_INCREMENT,
  `empleado` int(11) NOT NULL,
  `periodo` varchar(25) NOT NULL,
  `totalrec` decimal(11,2) NOT NULL,
  `total_comision` decimal(11,2) NOT NULL,
  `total` decimal(11,2) NOT NULL,
  `estado` varchar(15) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idliquidacion`),
  KEY `empleado_idx` (`empleado`),
  CONSTRAINT `empleado` FOREIGN KEY (`empleado`) REFERENCES `persona` (`idpersona`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS migrations;

CREATE TABLE `migrations` (
  `migration` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `batch` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS password_resets;

CREATE TABLE `password_resets` (
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `token` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  KEY `password_resets_email_index` (`email`),
  KEY `password_resets_token_index` (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS persona;

CREATE TABLE `persona` (
  `idpersona` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_apellido` varchar(60) NOT NULL,
  `dni` varchar(15) NOT NULL,
  `domicilio` varchar(45) NOT NULL,
  `telefono` varchar(25) NOT NULL,
  `tipo` varchar(45) NOT NULL,
  `estado` varchar(45) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idpersona`)
) ENGINE=InnoDB AUTO_INCREMENT=328 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS refinanciacion;

CREATE TABLE `refinanciacion` (
  `idrefinanciacion` int(11) NOT NULL AUTO_INCREMENT,
  `credito` int(11) NOT NULL,
  `cliente` varchar(45) NOT NULL,
  `saldo` decimal(11,2) NOT NULL,
  `plan` varchar(15) NOT NULL,
  `vencimiento` datetime NOT NULL,
  `estado` varchar(10) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idrefinanciacion`),
  KEY `idventa_idx` (`credito`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS resumen;

CREATE TABLE `resumen` (
  `idresumen` int(11) NOT NULL AUTO_INCREMENT,
  `zona` varchar(5) NOT NULL,
  `ingreso_semana` decimal(11,2) NOT NULL,
  `salida_semana` decimal(11,2) NOT NULL,
  `anticipo` decimal(11,2) NOT NULL,
  `estado` varchar(15) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idresumen`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS salida;

CREATE TABLE `salida` (
  `idsalida` int(11) NOT NULL AUTO_INCREMENT,
  `zona` varchar(15) NOT NULL,
  `monto` decimal(11,2) NOT NULL,
  `concepto` varchar(45) NOT NULL,
  `observaciones` varchar(55) NOT NULL,
  `estado` varchar(15) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idsalida`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `remember_token` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS venta;

CREATE TABLE `venta` (
  `idventa` int(11) NOT NULL AUTO_INCREMENT,
  `fecha_hora` datetime NOT NULL,
  `zona` varchar(5) NOT NULL,
  `idpersona` int(11) NOT NULL,
  `monto` decimal(11,2) NOT NULL,
  `plan` varchar(45) NOT NULL,
  `fecha_cancela` datetime NOT NULL,
  `concepto` varchar(45) NOT NULL,
  `empleado` varchar(45) NOT NULL,
  `estado` varchar(45) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`idventa`),
  KEY `idpersona_idx` (`idpersona`),
  CONSTRAINT `idpersona` FOREIGN KEY (`idpersona`) REFERENCES `persona` (`idpersona`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=latin1;



